const GoogleForm = () => (
    <div>
        <form action="https://docs.google.com/forms/u/0/d/e/1FAIpQLScQqZCHMp0Cw6xv3CvAAlQZf7bMmfnKz4qAXSh2_eRaInSjgw/formResponse" method="post">
           <input type='email' name="entry.1204567259" placeholder='mail'/>
           <input type='text' name="entry.570675750" placeholder='name'/>
           <textarea name="entry.1753231462" placeholder='message' rows='4'/>
        </form>
    </div>
)

export default GoogleForm;
